                    <div class="tab-pane  "  id = "tab3">


                        <html><head><meta charset="utf-8"></head><body>
<p>Состав:<br />- Протеин растительного происхождения &ndash; необходим для построения мышечных волокон тела, образования молока волосяного покрова;<br />- Жиры ― повышают энергетическую питательность корма;<br />- Углеводы &ndash; источник энергии и питательная среда для рубцовой микрофлоры;<br />- Кальций, фосфор, витамин D &ndash; для укрепления костной и мышечной систем;<br />- Витамин А и Е- для роста и размножения;<br />- Сера &ndash; для образования незаменимых аминокислот, здоровья кожи и крепости копыт;<br />- Магний &ndash; для укрепления нервной системы;<br />- Медь &ndash; для регуляции обменных процессов;<br />- Цинк и кобальт &ndash; для кроветворения, регуляции обмена углеводов и минеральных веществ;<br />- Йод &ndash; для улучшения функций щитовидной железы;<br />- Селен &ndash; для предотвращения некроза печени и беломышечной болезни;<br />- Соль поваренная &ndash; для регуляции осмотического давления и водно-солевого баланса организма.</p>
</body></html>
